DROP TABLE IF EXISTS district;
CREATE TABLE districts(
	did INT NOT NULL PRIMARY KEY, 
	dname VARCHAR(50) NULL,
	cid INT NULL,
	datecreated DATETIME NULL,
	dateupdated DATETIME NULL,
	FOREIGN KEY (cid) REFERENCES cities(cid));
    
